/* Default */
import React from 'react'

/* Packages */
import { NormalizeCss, Box, Flex, Track } from 'react-bee'

const App = () => {
  return (
    <>
      <NormalizeCss />
      <div style={{ background: 'grey' }}>
        <Box>
          <Flex justifyContent='' flexWrap='wrap'>
            <>
              {Array(2)
                .fill()
                .map((empty, i) => (
                  <Track
                    key={i}
                    background={`#${Math.floor(
                      Math.random() * 16777215
                    ).toString(16)}`}
                    flex='1 1 auto'
                  >
                    <Flex justifyContent='' flexWrap='wrap'>
                      <Track show>{i}</Track>
                      <Track show>{i}</Track>
                    </Flex>
                  </Track>
                ))}
            </>
          </Flex>
        </Box>
      </div>
    </>
  )
}

export default App

const TestTrack = ({ index, background }) => (
  <div style={{ background: background, padding: '10px', flex: '1 1 auto' }}>
    {index}
  </div>
)
